import images from './imageFiles.js';

const SelectedTranslationNovels = [{title: "Bắt Đầu Làm Thần Hào Từ Sau Khi Thi Đại Học", before: "", 
    name: "Bắt Đầu Làm Thần Hào Từ Sau Khi Thi Đại Học", after: "", chapter: "Chương 3565"},
    {title: "Đan Hoàng Võ Đế", before: "", name: "Đan Hoàng Võ Đế", after: "", chapter: "Chương 3564"},
    {title: "Thì Ra Ta Là Tuyệt Thế Võ Thần", before: "", name: "Thì Ra Ta Là Tuyệt Thế Võ Thần", after: "", chapter: "Chương 1312"},
    {title: "Trở lại Thập Niên 70: Mang Theo Thành Thị Làm giàu", before: "Trở lại Thập Niên 70: ", 
    name: "Mang Theo Thành Thị Làm giàu", after: "", chapter: "Full"},
    {title: "Người Đọc Sách Đại Ngụy", before: "", name: "Người Đọc Sách Đại Ngụy", after: "", chapter: "Chương 3565"},
    {title: "Bất Phụ Vinh Quang, Bất Phụ Em", before: "", name: "Bất Phụ Vinh Quang, Bất Phụ Em", after: "", chapter: "Chương 553"},
    {title: "[Thập Niên 60] Gây Dựng Lại Gia Đình", before: "[Thập Niên 60] ", name: "Gây Dựng Lại Gia Đình", after: "", 
    chapter: "Chương 163"},
    {title: "[Thập Niên 70] Kiều Tức Phụ", before: "[Thập Niên 70] ", name: "Kiều Tức Phụ", after: "", chapter: "Chương 246"}];

for (let i = 0; i < SelectedTranslationNovels.length; i++)
{
    SelectedTranslationNovels[i].image = images.translatedNovels[i];
}



const dataDefault = {SelectedTranslationNovels: SelectedTranslationNovels};

export default dataDefault;
